const API_URL = "http://localhost:8080/camiones/";

export const getAllCamiones = async () => {
    return await fetch(API_URL);
};

export const getCamionById = async (idCamion) => {
    return await fetch(`${API_URL}${idCamion}`);
};

export const registerEmpleado = async (nuevoCamion) => {
    return await fetch(API_URL, {
        method:'POST',
        headers:{
            'Content-Type':'application/json'
        },
        body: JSON.stringify({
            "nombre":String(nuevoCamion.nombre).trim(),
            "temperatura":String(nuevoCamion.temperatura).trim(),
            "salario":parseInt(nuevoEmpleado.salario),
        })
    });
};
